import { lazy } from 'react'

const HrRoutes = [
  {
    path: '/hr/man-power',
    title:'Man Pawer',
    component: lazy(() => import('../../views/pages/hr/Man-power'))
  },
  {
    path: '/hr/daily-Turnover',
    title:'Daily Turnover',
    component: lazy(() => import('../../views/pages/hr/DailyTurnOver'))
  },
  {
    path: '/hr/contractor-detail',
    title:"Employee Registration",
    component: lazy(() => import('../../views/pages/hr/Contractor'))
   },
    {
      path: '/hr/employee-registration',
      title:"Employee Registration",
      component: lazy(() => import('../../views/pages/hr/EmployeRegistration'))
    }
]


export default HrRoutes
